import { Button } from "@mui/material";
import { Theme } from "../../others/Theme";

export const SwitchButton = ({ text, href }) => {
  console.log(href);
  return (
    <Button
      sx={{
        backgroundColor: Theme.palette.primary.light,
        color: "#888",
        "&:hover": {
          backgroundColor: Theme.palette.primary.main,
        },
      }}
      variant="contained"
      href={href}
    >
      {text}
    </Button>
  );
};
